let days=document.querySelector(".timer-container .countdonw-container .days [data-set = day]"),hours=document.querySelector(".timer-container .countdonw-container .hours [data-set = hour]"),minutes=document.querySelector(".timer-container .countdonw-container .mins [data-set = minute]"),seconds=document.querySelector(".timer-container .countdonw-container .secs [data-set = second]"),countDown=new Date("june 5 ,2023 , 00:00:00").getTime(),counter=setInterval(()=>{let e=(new Date).getTime(),t=countDown-e,n=Math.floor(t/1e3/60/60/24);days.textContent=n;let o=Math.floor(t%864e5/36e5);hours.textContent=o;let r=Math.floor(t%36e5/6e4);minutes.textContent=r;let a=Math.floor(t%6e4/1e3);seconds.textContent=a},1e3);